function MReco1(props) {
  return (
    <div>
      <div class="reco">
        <div className="reco-item">
          <img src={props.mangaReco.image} alt={props.mangaReco.image}></img>
          <span>{props.mangaReco.name}</span>
        </div>
      </div>
    </div>
  );
}

export default MReco1;
